settings\u0004Note: To disable a context:
Remarque : Pour désactiver un élément du menu contextuel,
copiez-le dans les préférences utilisateur et ajoutez l'attribut
"désactivé". L'exemple suivant désactivera le téléchargement de l'élément sur les fichiers:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "sélecteur": ". p-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

Description du menu contextuel :

settings\u0004Note: To disable a menu or:
Remarque : Pour désactiver un élément de menu ou un menu,
copiez-le dans les préférences utilisateur et ajoutez la touche
"disabled". L'exemple suivant désactivera
le menu "Onglet" et "Redémarrer le noyau et Exécuter jusqu'à la cellule sélectionnée"
élément :
{
  "menus": [
    {
      "id": "jp-mainmenu-tabulations",
      "désactivé": vrai
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "désactivé" : vrai
        }
      ]
    }
  ]
}

