settings\u0004Note: To disable a toolbar:
Remarque : Pour désactiver un élément de la barre d'outils,
copiez-le dans les préférences utilisateur et ajoutez l'attribut
"disabled". L'exemple suivant désactivera le bouton pour interrompre l'exécution:
{
  "toolbar": [
    {
      "name": "interrupt",
      "disabled": true
    }
  ]
}

Description de la barre d'outils :

Remarque : Pour désactiver un élément de la barre d'outils,
copiez-le dans les préférences utilisateur et ajoutez l'attribut
"disabled". L'exemple suivant désactivera le sélecteur du caractère de délimitation:
{
  "toolbar": [
    {
      "name": "delimiter",
      "disabled": true
    }
  ]
}

Description de la barre d'outils :

Remarque : Pour désactiver un élément de la barre d'outils,
copiez-le dans les préférences utilisateur et ajoutez l'attribut
"disabled". L'exemple suivant désactivera le bouton pour rafraichir la page:
{
  "toolbar": [
    {
      "name": "refresh",
      "disabled": true
    }
  ]
}

Description de la barre d'outils :

settings\u0004Overrides for where to sho:
Modifie la barre latérale utilisée pour afficher un panneau
par exemple, {"jp-debugger-sidebar": "left"}
Vous pouvez également modifier cela en cliquant avec le bouton droit de la souris sur les icônes de la barre latérale.

settings\u0004Language-server specific c:
Configuration spécifique du serveur de language, trie par l'implémentation, par exemple: 

pyls: {
  serverSettings: {
    pyls: {
      plugins: {
        pydocstyle: {
          enabled: true
        },
        flocons : {
          enabled: false
        },
        flake8 : {
          enabled: true
        }
      }
    }
  }
}

Alternativement, en utilisant la convention de nommage de VSCode:

pyls: {
  serverSettings: {
    "pyls. lugins.pydocstyle.enabled": true,
    "pyls.plugins.pyflakes.enabled": false,
    "pyls.plugins.flake8.enabled": true
  }
}

